import "./Calculator.css";
import { getByDisplayValue, render } from "@testing-library/react";
import { useEffect, useReducer, useState } from "react";

export default function Calculator() {
  const operators = ["+", "-", "*", "/"];
  return (
    <>
      <h1>Calculator</h1>
      <table className="cal">
        <tr>
          <td>
            <button>+</button>
          </td>
          <td>
            <button>-</button>
          </td>
          <td>
            <button>*</button>
          </td>
        </tr>

        {Array(3)
          .fill(null)
          .map((v, j) => (
            <tr>
              {Array(3)
                .fill(null)
                .map((v, i) => (
                  <td>
                    <button>{i + j}</button>
                  </td>
                ))}
            </tr>
          ))}
      </table>
    </>
  );
}
